import React from 'react'
import ReactDOM from 'react-dom'
import './index.css'

const Button = (props) => {
  return (
    <button onClick = {props.handleClick}>
      {props.text}
    </button>
  )
}

const Song = ({link}) => {
  return (
    <>
      <iframe title = "pog" src={link} width="300" height="80" frameborder="0" allowtransparency="true" allow="encrypted-media"></iframe>
      <br/>
    </>
  )
}

const App = () => {
  const pog1 = () => {console.log("pog1")}
  const pog2 = () => {console.log("pog2")}
  return (
    <div>
      <h1>
        pog
      </h1>
      <div class="container">
        <div class="fixed">
          <h2>
            Song 1
          </h2>
          <Song link="https://open.spotify.com/embed/track/1UGD3lW3tDmgZfAVDh6w7r"/>
          <Button handleClick={pog1} text='pog1'/>
        </div>
        <div class="grow">
          <h2>
            Song 2
          </h2>
          <Song link="https://open.spotify.com/embed/track/1UGD3lW3tDmgZfAVDh6w7r"/>
          <Button handleClick={pog2} text='pog2'/>
        </div>
      </div>
    </div>
  )
}

ReactDOM.render(<App />, document.getElementById('root'))
